Cromnia is developed to improve the autonomy of people with visual disabilities. It's born to solve the fundamental needs that are often taken for granted by people without visual disabilities. 

Cromnia, through the use of the camera, is able to: 
Recognize the color of the framed object;
Recognize the texture of the clothes;
Recognize the brightness of the environment;
Suggest good color combinations.

Cromnia is developed following the best practices of Apple for accessibility.  VoiceOver is implemented and it is enhanced for a clear notification system for the user. Interface elements have been appropriately labelled and arranged in such a way to ensure the best end user experience and usability.

The color combination is based on the famous Itten circle: thanks to it you will be able to find out if what you have chosen is a good match!

The textures recognized by Cromnia are: Solid color, Stripes, Checks, Diamonds, Design, Pois.
